        return 0
    jumps = 1
    max_reach = arr[0]
    step = arr[0]
    for i in range(1, n):
        if (i == n - 1):
            return jumps
        max_reach = max(max_reach, i + arr[i])
        step -= 1
        if (step == 0):
            jumps += 1
            step = max_reach - i
            if (step == 0):
                return -1
    return -1
