  elif (n**2 + n2**2 == n3**2) or (n**2 + n3**2 == n2**2) or (n2**2 + n3**2 == n**2):
    return "Right-angled Triangle"
  elif (n**2 + n2**2 > n3**2) or (n**2 + n3**2 > n2**2) or (n2**2 + n3**2 > n**2):
