def sum_of_odd_Factors(n):
    total = 1
    i = 3
    while i * i <= n:
        if n % i == 0:
            power = 0
            while n % i == 0:
                n = n / i
                power += 1
            total = total * (i ** power - 1) / (i - 1)
        i += 2
    if n > 1:
        total = total * (n * n - 1) / (n - 1)
    return int(total)
