def sqrt_root(n):
  if n < 0:
    return -1
  if n == 0 or n == 1:
    return n
  left = 1
  right = n
  while left <= right:
    mid = (left + right) // 2
    if mid * mid == n:
      return mid
    elif mid * mid > n:
      right = mid - 1
    else:
      left = mid + 1
  return -1
```

